import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CrmRoutingModule } from '../crm-routing/crm-routing.module';
import { ViewEnquiryComponent } from 'src/app/crm/view-enquiry/view-enquiry.component';
import { ReqcibilComponent } from 'src/app/crm/reqcibil/reqcibil.component';



@NgModule({
  declarations: [
    ViewEnquiryComponent,
    ReqcibilComponent,
    ApplyLoanComponent
  ],

  imports: 
  [
    CommonModule,
    CrmRoutingModule
  ]
})
export class CrmModule { }
